// <
void Prelude__LT_hnf(field root)
{
  debug(LOW, "HNF <:\n");
  debug_expr(LOW, root);
  field v2;
  v2 = child_at(root, 0);
  field v2_forward = v2;
  {
    bool nondet = false;
    while(true)
    {
      nondet |= v2_forward.n->nondet;
      switch(v2_forward.n->symbol->tag)
      {
        case FAIL_TAG:
        {
          if(nondet)
          {
            save(root, make_Prelude__LT_(v2, 0));
          }
          fail(root);
          debug(LOW, "leaving <\n");
          debug_expr(LOW, root);
          return;
        }
        case FUNCTION_TAG:
        {
          HNF(v2_forward);
          break;
        }
        case CHOICE_TAG:
        {
          choose(v2_forward);
          break;
        }
        case FORWARD_TAG:
        {
          v2_forward = child_at(v2_forward, 0);
          break;
        }
        case FREE_TAG:
        {
          push_frame(v2_forward, free_var());
          set_Prelude__USDict_HTOrd_free(v2_forward);
          nondet = true;
          break;
        }
        case Prelude__USDict_HTOrd_TAG:
        {
          if(nondet)
          {
            save(root, make_Prelude__LT_(v2, 0));
          }
          field v3;
          field v4;
          field v5;
          field v6;
          field v7;
          field v8;
          field v9;
          field v10;
          v10 = child_at(v2_forward, 0);
          field v10_forward = v10;
          v9 = child_at(v2_forward, 1);
          field v9_forward = v9;
          v8 = child_at(v2_forward, 2);
          field v8_forward = v8;
          v7 = child_at(v2_forward, 3);
          field v7_forward = v7;
          v6 = child_at(v2_forward, 4);
          field v6_forward = v6;
          v5 = child_at(v2_forward, 5);
          field v5_forward = v5;
          v4 = child_at(v2_forward, 6);
          field v4_forward = v4;
          v3 = child_at(v2_forward, 7);
          field v3_forward = v3;
          set_forward(root, v7);
          debug(LOW, "leaving <\n");
          debug_expr(LOW, root);
          return;
        }
      }
    }
  }
}

